// this function is used to select the option from 'Solid fill' and ' wireframe' and is called from createMenu function

void selectMenu(int option) {

	switch (option) {

	case 1: 	glPolygonMode(GL_FRONT, GL_FILL);        //GL_LINE will display frame
		glPolygonMode(GL_BACK, GL_FILL);
		glutPostRedisplay();
		break;

	case 2:  glPolygonMode(GL_FRONT, GL_LINE);        //GL_LINE will display frame
		glPolygonMode(GL_BACK, GL_LINE);
		glutPostRedisplay();
		break;
	}

}

// This function creates the menu and adds the entries which are displayed on right click of mouse button

void createMenu() {


	menu = glutCreateMenu(selectMenu);
	//add entries to our menu
	glutAddMenuEntry("Solid Fill", 1);
	glutAddMenuEntry("Wireframe", 2);


	// attach the menu to the right button
	glutAttachMenu(GLUT_RIGHT_BUTTON);

}

// The mouse functions handles all the mouse interaction such as rotation 
void mouse(int button, int state, int x, int y) {

	// left button is clicked and held.
	if (button == GLUT_LEFT_BUTTON && state == GLUT_DOWN) {

		mouseDown = TRUE;		// if the left mouse button is clicked this value is set to TRUE.
		
		diffX = x - RotY;      // Difference is calculated for X 
		diffY = -y + RotX;		// Similarly difference is calculated for Y.
	}
	else mouseDown = FALSE;
}


// This is the display function which displayed the face model and the changes applied to it.

void display(void)
{
	glClear(GL_COLOR_BUFFER_BIT);
	glMatrixMode(GL_MODELVIEW);
	glLoadIdentity();
	
	

	glScalef(zoom, zoom, 1.0);				// The scaling function to display the zooming changes
	glRotatef(RotX, 1.0f, 0.0f, 0.0f);			// rotation along X axis 
	glRotatef(RotY, 0.0f, 1.0f, 0.0f);			// Rotation along Y axis

	glColor3f(0.0, 1.0, 0.0);         //  Set fill color to green.

	int i, j, temp1, temp2, temp3;		

	for (i = 0; i < 13806; i++) {
		j = 0;

		// Here the face indices are copied into temporary variables

		temp1 = face_indicies[i][j];			// Point 1 of the each row is temporarily stored in 'temp1'	
		temp2 = face_indicies[i][j + 1];		// Point 2 of the each row is temporarily stored in 'temp2'
		temp3 = face_indicies[i][j + 2];		// Point 3 of the each row is temporarily stored in 'temp3'


		glBegin(GL_TRIANGLE_STRIP);
		glVertex3f(vertices[temp1][0], vertices[temp1][1], vertices[temp1][2]);			// Here each face index is assigned to the vertex array. Here point 1 of face index array is mapped to vertex array
		glVertex3f(vertices[temp2][0], vertices[temp2][1], vertices[temp2][2]);			// Here point 2 of face index array is mapped to vertex array 
		glVertex3f(vertices[temp3][0], vertices[temp3][1], vertices[temp3][2]);			// Here point 3 of face index array is mapped to vertex array
		glEnd();

	}

	glFlush();
}

// THis dragMotion Function the rotation of the face model

void dragMotion(int x, int y) {

	if (mouseDown) {

		RotY = x - diffX;		// Angle X to be rotated is calculated from these values
		RotX = y + diffY;		// Angle Y to be rotated is calculated from these values
		glutPostRedisplay();
	}
}

// The keyboard function defines the positive and negative zoom

void keyboard(unsigned char key, int x, int y) {
	glMatrixMode(GL_MODELVIEW);
	glLoadIdentity();

	if (zoom <= 0.1)		// setting the boundary limit beyond which the face model wont be reduced
		zoom = 0.1;
	if (key == 'z')			// Positive Zoom or Zooming In
		zoom += 0.1;
	if (key == 'x')
		zoom -= 0.1;		// Negative zoom or Zoom Out

	glutPostRedisplay();

}

// Main Function

int main(int argc, char** argv)
{
	glutInit(&argc, argv);
	glutInitDisplayMode(GLUT_SINGLE | GLUT_RGB);
	glutInitWindowPosition(50, 50);
	glutInitWindowSize(winWidth, winHeight);
	glutCreateWindow("Assignment 2 3D modelling");

	glClearColor(1.0, 1.0, 1.0, 0.0);

	createMenu();
	glutDisplayFunc(display);
	glutMouseFunc(mouse);
	glutKeyboardFunc(keyboard);
	glutMotionFunc(dragMotion);

	glutMainLoop();

}
